peticiones.LoadEnvioGeneral = function LoadEnvioGeneral(orden) {
  var envio = {}; //ENVIOS

  if (orden.trim() != '') {
    envio.sort = orden;
  } //PAGINACION CANTIDAD LIST


  var paginacion = $("#paginateData").val();

  if (paginacion) {
    var page = paginacion.toString();

    if (page.trim() != '') {
      if (isNaN(page)) {
        $("#body-errors-modal").html("ingrese un numero válido, en un rango de [15-50]");
        $('#errorsModal').modal('show');
        return false;
      }

      if (parseInt(page) < 15 || parseInt(page) > 100) {
        $("#body-errors-modal").html("ingrese un rango de filtro de [15-50]");
        $('#errorsModal').modal('show');
        return false;
      }

      envio.paginate = paginacion;
    }
  } //ENVIO INPUT TEXT


  var nombreSearch = $("#nombre").val();
  var apellidoSearch = $("#apellidos").val();
  var documentoSearch = $("#documento").val();
  var usuarioSearch = $("#usuario").val();
  var validaTextoSearch = /[a-zA-Z]/;
  var validaNumbersSearch = /[0-9]/;

  if (nombreSearch.toString().trim() != '') {
    if (!validaTextoSearch.test(nombreSearch)) {
      $("#body-errors-modal").html("El campo nombre debe tener almenos una letra");
      $('#errorsModal').modal('show');
      return false;
    }

    envio.nombre = nombreSearch;
  }

  if (apellidoSearch.toString().trim() != '') {
    if (!validaTextoSearch.test(apellidoSearch)) {
      $("#body-errors-modal").html("El campo apellidos debe tener almenos una letra");
      $('#errorsModal').modal('show');
      return false;
    }

    envio.apellidos = apellidoSearch;
  }

  if (documentoSearch.toString().trim() != '') {
    if (!validaNumbersSearch.test(documentoSearch)) {
      $("#body-errors-modal").html("El campo documento debe ser en formato números");
      $('#errorsModal').modal('show');
      return false;
    }

    envio.documento = documentoSearch;
  }

  if (usuarioSearch.toString().trim() != '') {
    if (!validaTextoSearch.test(usuarioSearch)) {
      $("#body-errors-modal").html("El campo usuario debe tener almenos una letra");
      $('#errorsModal').modal('show');
      return false;
    }

    envio.usuario = usuarioSearch;
  } //END ENVIO TEXT INPUT


  return envio;
};

peticiones.cargalistUsuariosTable = function cargalistUsuariosTable(res) {
  var DataCollection = res.response.data;
  var pageR = res.response.meta.pagination;
  var count = parseInt(parseInt(pageR.current_page) - parseInt(1)) * parseInt(pageR.per_page) + parseInt(1); //let from = count

  var permisos = res.permisos;
  var tabla = "";
  DataCollection.forEach(function (el) {
    tabla += "<tr>";
    tabla += "<td class=\"text-center\"> ".concat(count++, "</td>");
    tabla += "<td class=\"text-center\"> ".concat(el.nombre, "</td>");
    tabla += "<td class=\"text-center\"> ".concat(el.apellidos, "</td>");
    tabla += "<td class=\"text-center\"> ".concat(el.usuario, "</td>");
    tabla += "<td class=\"text-center\"> ".concat(el.documento, "</td>");

    if (permisos != null) {
      tabla += "<td class=\"text-center\">";

      if (permisos.show) {
        tabla += "\n              <a href=\"/administrador/usuario/".concat(el.identificador, "/detalle\" class=\"btn btn-outline-primary btn-sm shadow-sm p-1 accionUsuarioShow\"><i class=\"fa fa-eye icon-accion\"></i></a>\n          ");
      }

      if (permisos.edit) {
        tabla += "\n              <a href=\"/administrador/usuario/".concat(el.identificador, "/editar\" class=\"btn btn-outline-success btn-sm shadow-sm p-1 accionUsuarioEdit\" ><i class=\"fa fa-pencil icon-accion\"></i></a>\n          ");
      }

      if (permisos["delete"]) {
        tabla += "\n              <a href=\"javascript:void(0)\" class=\"btn btn-outline-danger btn-sm shadow-sm p-1 accionUsuarioDelete\"  data-id=\"".concat(el.identificador, "\"><i class=\"fa fa-trash icon-accion\"></i></a>\n          ");
      }

      tabla += "</td>";
    }

    tabla += "<tr>";
  });
  $("#result_iteraction_list").html(tabla);
}; //Store
