peticiones.seleccionarPermisosByRoles = function seleccionarPermisosByRoles(idRol, dataIdent, modalShow) {
  $.ajax({
    url: "/administrador/roles/".concat(parseInt(idRol), "/permisos"),
    method: "get",
    dataType: "json"
  }).done(function (data) {
    //console.log("los permisos del rol seleccionado:", data)
    var permisosSegunRol = data.response.data;
    permisosSegunRol.forEach(function (el) {
      //console.log(el);
      $("input#check".concat(dataIdent) + el.identificador).prop('checked', true);
      $("input#check".concat(dataIdent) + el.identificador).prop('disabled', true);
    });
    modalShow.modal("show");
  }).fail(function (jqXHR, textStatus) {
    console.log("Request failed: ", textStatus, jqXHR);
    $("#body-errors-modal").html("Hubo un error en el servicio de permisos, intente nuevamente por favor!");
    $('#errorsModal').modal('show'); //console.log( "Request failed: " ,jqXHR.responseJSON.mensaje);
  });
};

